import React, { Component } from 'react'

export default class Post extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-12 jumbotron text-center">
                        <h1>Posts</h1>
                    </div>
                </div>

            </div>
        )
    }
}
